import React from "react";

const Avatar = ({ image, scale }) => {
  const heigth = 48;
  width = 48;
  if(scale === "md"){
    height = 48;
    width = 48;
  }
  console.log(height,width);
  return (
    <div className={`h-[${height}px] w-[${width}px] rounded-full shadow-md overflow-hidden`}>
      <img src={image} className="w-full h-full object-cover" alt="avatar" />
    </div>
  );
};

export default Avatar;
